import React from "react";
import { useNavigate } from "react-router-dom";
import styled from "styled-components";
import SButton from "../ui/SelectButton";
import Template from "../ui/template";
import Stemplate from "../ui/Selectbox"
import B1img from "../ui/B1img";
import B2img from "../ui/B2img";

const IntroText = styled.p`
    font-size: 20px;
    font-weight: 900;
    text-align: center;
    color: #FFFFFF;
    margin-top: 20%;
    margin-bottom: 1%;
    letter-spacing: 2px;
    line-height:170%;

`;


const MainTitleText = styled.p`
position: absolute;
width: 241px;
height: 58px;
left: 20px;
top: 20px;

font-family: 'Gmarket Sans TTF';
font-style: normal;
font-weight: 700;
font-size: 50px;
line-height: 57px;
/* identical to box height */
text-align: center;

color: #FFFFFF;

    letter-spacing: 2px;
`;

const Container = styled.div`
    width: 100%;
    max-width: 720px;



    & > * {
        :not(:last-child) {
            margin-bottom: 16px;
        }
    }
`;



function Intropage(props) {
    const navigate = useNavigate();

    return (


        <Template>
          <MainTitleText>알쏭달쏭?!</MainTitleText>

                <Stemplate>
                  <B1img/>
                <SButton
                    title="START"
                    onClick={() => {
                        navigate("/main-page");
                    }}
                />
                </Stemplate>
              <Stemplate>
                <B2img/>
                 <SButton
                    title="START"
                    onClick={() => {
                        navigate("/main-page");
                    }}
                />
                </Stemplate>
        </Template>


    );
}

export default Intropage;
